INSERT INTO `alldata` VALUES ('1823', 'amulet', 'pre Han Dynasty, Chou Dynasty possibly', 'China', null, null, null, null, null, null, null, null, 'http://collections.glasgowmuseums.com/MWEBimages/Thumb/PhotoLib_Batch_0077/22.90_01_T.jpg', 'Jade amulet in the form of a bell with slight incised decoration of lines and dentate leaves.  Brownish-green mottle with russet veins.', 'pre Han Dynasty, Chou Dynasty possibly', null, null, '5');
INSERT INTO `alldata` VALUES ('1824', 'amulet', 'Han Dynasty or earlier', 'China', null, null, null, null, null, null, null, null, 'http://collections.glasgowmuseums.com/MWEBimages/Thumb/PhotoLib_Batch_0077/22.92_01_T.jpg', 'Jade amulet, in the form of a man.  Pale grey mottle with russet veins.  The human form is rare in this early jade.', 'Han Dynasty or earlier', null, null, '5');
