INSERT INTO `alldata` VALUES ('1976', 'bowl', 'Tang Dynasty, 618-906', 'China', null, null, null, null, null, null, null, null, 'http://collections.glasgowmuseums.com/MWEBimages/Thumb/PhotoLib_Batch_0345/38.212_01_T.jpg', 'Small bowl, of earthenware, the outside with relief moulding, floral on base and imbricated on sides.  Dappled cream, green, orange and brown glazes. The inside with dapple in the centre and vertical lining in cream, green and brown.', 'Tang Dynasty', null, null, '5');
INSERT INTO `alldata` VALUES ('1977', 'bowl', 'late Sung Dynasty', 'China', null, null, null, null, null, null, null, null, 'http://collections.glasgowmuseums.com/MWEBimages/Thumb/PhotoLib_Batch_0073/38.259_01_T.jpg', 'Bowl, of porcelain, thinly potted, with six lobed rim, and incised floral design.  Inside and outside a pale blue Ying Ching glaze.  Burnt brown at base where there is an indication of a firing ring.', 'late Sung Dynasty', null, null, '5');
INSERT INTO `alldata` VALUES ('1978', 'bowl', 'Sung Dynasty', 'China', null, null, null, null, null, null, null, null, 'http://collections.glasgowmuseums.com/MWEBimages/Thumb/PhotoLib_Batch_0155/38.270_01_T.jpg', 'Bowl, of earthenware, with unglazed mouth rim, inside a cream glaze and outside a black tea-dust glaze.', 'Song Dynasty', null, null, '5');
INSERT INTO `alldata` VALUES ('1979', 'bowl', 'Sung Dynasty', 'China', null, null, null, null, null, null, null, null, 'http://collections.glasgowmuseums.com/MWEBimages/Thumb/Photo_007/38.300_01_T.jpg', 'Bowl, of porcelain, the outside radially petal moulded.  Pale green celadon glaze inside and out with large pattern crazing inside and smaller outside.', 'Song Dynasty', null, null, '5');
INSERT INTO `alldata` VALUES ('1980', 'bowl', 'Neolithic, Prehistoric, circa  BC, possibly', 'China', null, null, null, null, null, null, null, null, 'http://collections.glasgowmuseums.com/MWEBimages/Thumb/PhotoLib_Batch_0345/38.32_01_T.jpg', 'Bowl with everted rim, of red earthenware.  Two side projections for suspension.  Black brushwork decoration of lines and loops on upper half and inside rim.', 'Neolithic, Prehistoric,  BC, possibly', null, null, '5');
INSERT INTO `alldata` VALUES ('1981', 'bowl', 'late Sung Dynasty or Yuan Dynasty', 'China', null, null, null, null, null, null, null, null, 'http://collections.glasgowmuseums.com/MWEBimages/Thumb/PhotoLib_Batch_0298/38.320_01_T.jpg', 'Shallow bowl, of stoneware, flattish mouth rim with turned up edge.  Inside a floral and fruit relief border, with in the centre a peony medallion.  Pale grey-green celadon glaze inside and out.', 'late Sung Dynasty or Yuan Dynasty', null, null, '5');
INSERT INTO `alldata` VALUES ('1982', 'bowl', 'Sung Dynasty', 'China', null, null, null, null, null, null, null, null, 'http://collections.glasgowmuseums.com/MWEBimages/Thumb/Photo_007/38.351_01_T.jpg', 'Bowl, of stoneware, with pronounced ridge near the mouth rim, and with throwing ridges below.  Dark brownish-black glaze inside and ending irregularly outside.  Slightly lustrous and with some lighter patches.', 'Song Dynasty', null, null, '5');
INSERT INTO `alldata` VALUES ('1983', 'bowl', 'Sung Dynasty', 'China', null, null, null, null, null, null, null, null, 'http://collections.glasgowmuseums.com/MWEBimages/Thumb/Photo_007/38.352_01_T.jpg', 'Bowl, of stoneware, with pronounced ridge near the mouth rim. Brownish-black glaze inside with three areas of light brown splashing extending from mouth rim.  Brownish- black glaze outside ends very irregularly, short of foot rim.', 'Song Dynasty', null, null, '5');
INSERT INTO `alldata` VALUES ('1984', 'bowl', 'Sung Dynasty', 'China', null, null, null, null, null, null, null, null, 'http://collections.glasgowmuseums.com/MWEBimages/Thumb/Photo_007/38.356_01_T.jpg', 'Bowl, of fine stoneware, with slightly inverted mouth rim, glazed outside with a streaked brown-black glaze becoming blackish towards the foot rim, and ending unevenly.', 'Song Dynasty', null, null, '5');
INSERT INTO `alldata` VALUES ('1985', 'bowl', 'Sung Dynasty', 'China', null, null, null, null, null, null, null, null, 'http://collections.glasgowmuseums.com/MWEBimages/Thumb/Photo_007/38.357_01_T.jpg', 'Bowl, of stoneware, with pronounced throwing ridges, and everted mouth rim. Black glazed inside and similar glaze outside ending unevenly short of foot rim, and with considerable lustrous patches.', 'Song Dynasty', null, null, '5');
INSERT INTO `alldata` VALUES ('1986', 'bowl', 'Sung Dynasty', 'China', null, null, null, null, null, null, null, null, 'http://collections.glasgowmuseums.com/MWEBimages/Thumb/PhotoLib_Batch_0073/38.365_01_T.jpg', 'Small, shallow bowl, of stoneware, with dark brownish-black glaze ending short of foot rim outside.', 'Song Dynasty', null, null, '5');
INSERT INTO `alldata` VALUES ('1987', 'bowl', 'Sung Dynasty', 'China', null, null, null, null, null, null, null, null, 'http://collections.glasgowmuseums.com/MWEBimages/Thumb/PhotoLib_Batch_0285/38.389_01_T.jpg', 'Bowl, of stoneware, with ridged shoulder and inverted mouth rim, decorated with cream coloured slip, ending unevenly short of the base rim, and having five large ovoid patches of brownish-black lustrous glaze overlaid on slip.', 'Song Dynasty', null, null, '5');
INSERT INTO `alldata` VALUES ('2646', 'dish', 'Qing Dynasty, Kangxi period, 1662-1722', 'China', null, null, null, null, null, null, null, null, 'http://collections.glasgowmuseums.com/MWEBimages/Thumb/Photo_005/38.928_01_T.jpg', 'Dish, porcelain, saucer-shaped, decorated in famille verte enamels; central medallion containing rocks, trees and birds in garden setting, and eight radiating shaped panels containing landscpaes, po-ku emblems and flowering plants.', 'Neoteric Times', null, null, '5');
INSERT INTO `alldata` VALUES ('2770', 'ewer', 'Tang Dynasty, 618-906', 'China', null, null, null, null, null, null, null, null, 'http://collections.glasgowmuseums.com/MWEBimages/Thumb/Photo_007/38.187_01_T.jpg', 'Large ewer of earthenware, globular, with everted base and tall neck.  A portion of the mouth fashioned into a spout of cock\'s head form.  Handles in the form of dragons springing from the shoulder and biting the rim (one of a pair with 38.186).', 'Tang Dynasty', null, null, '5');
INSERT INTO `alldata` VALUES ('3158', 'incense burner', 'Ming Dynasty, 16th century', 'China', null, null, null, null, null, null, null, null, 'http://collections.glasgowmuseums.com/MWEBimages/Thumb/Photo_007/38.562_01_T.jpg', 'Tripod incense burner, of stoneware, shaped as a bronze T\'ing with two side handles; enamelled outside on the biscuit with turquoise, aubergine, yellow and white glazes, with floral and leaf designs.', 'Ming Dynasty, Ming Dynasty', null, null, '5');
